      SELECT - COUNT ( * ) + 67 FROM tab1 (FORMAT parquet) cor0 WHERE NOT - 3 NOT BETWEEN + col1 * - col1 AND ( - 29 / - 24 + - 42 * 0 );
  - name: tab1

outputs:
  - name: q12081.out
    data: |
      64
